import React from 'react';
import 'react-bulma-components/dist/react-bulma-components.min.css';
import { Hero, Heading, Menu } from 'react-bulma-components';
// import MenuComponent from './Menu.js';

const HeroComponent = () => {
    return (
    <Hero size="large">
      <Hero.Head renderAs="header">
          <Menu/>
        <div className="bd-notification is-info">Hybrid Insurance</div>
      </Hero.Head>
      <Hero.Body >
        <div>
         <h1>Hybrid Insurance</h1>
          Adaptive insurance for you & your vehicle - drive to inspire
        </div>
      </Hero.Body>
      <Hero.Footer>
        <div className="bd-notification is-danger"></div>
      </Hero.Footer>
    </Hero>
    )
    }
export default HeroComponent
